import { loadFromLocalStorage, saveToLocalStorage } from "./localStorage.js";
import { generateId, createArticle } from "./02_logic.js";
const articles = loadFromLocalStorage("articles") || {};
const articleImages = loadFromLocalStorage("images") || {};

const imgData =
  "data:image/jpeg;base64,";

const newId = generateId();

function createInitialArticle() {
  if (
    Object.keys(articles).length == 0 &&
    Object.keys(articleImages).length == 0
  ) {
    saveImgData2(newId, imgData);
    createArticle(
      {
        title: { value: "Template Article" },
        author: { value: "Nikos" },
        body: "lorem",
        category: { value: "Technology" },
      },
      newId
    );
  }
}

function saveImgData2(id, imgData) {
  articleImages[id] = {
    imgData: imgData,
    imgName: "initial-image",
    id: id,
  };
  saveToLocalStorage("images", articleImages);
}

createInitialArticle();
